const pdfMake = require("../pdfmake/pdfmake");
const vfsFonts = require("../pdfmake/vfs_fonts");
pdfMake.vfs = vfsFonts.pdfMake.vfs;

exports.generatePdf = function teste(orcamento) {
  const concatArray = getConcatedArray(orcamento);
  const contentArray = getContentArray(orcamento);

  return (docDefenition = {
    content: [...concatArray, ...contentArray]
  });
};

function getConcatedArray(orcamento) {
  const heigthPositionForDesignacaoTecnica = 390; //salto de 15 por linha
  const heigthPositionForPropostaComercial = 310; //salto de 15 por linha

  let propostaComercial = orcamento.propostaComercial
    .replace(/&nbsp;/g, "")
    .split(".");

  const designacaoTecnica = orcamento.designacaoTecnica
    .replace(/&nbsp;/g, "")
    .split(".");

  const propostaComercialArray = concatArrayForPdf(
    propostaComercial,
    heigthPositionForPropostaComercial
  );
  const designacaoTecnicaArray = concatArrayForPdf(
    designacaoTecnica,
    heigthPositionForDesignacaoTecnica
  );

  return [...propostaComercialArray, ...designacaoTecnicaArray];
}

function concatArrayForPdf(arrayForConcatenation, heightOfTheFirstElement) {
  let newArray = [];

  let newHeight = heightOfTheFirstElement + 15;

  arrayForConcatenation.forEach(element => {
    newArray.push({
      absolutePosition: { x: 30, y: newHeight },
      text: `${element}`,
      fontSize: 12
    });
    newHeight = newHeight + 15;
  });

  return newArray;
}

